resource "common_functions"
{
  function answer_question() {
    local question="$1"

    if [[ "$question" == *"sind bei cpr die kompressionen wichtiger als die luftzufuhr"* ]]; then
      echo "ja"
    else
      echo "nein"
    fi
  }
}

# call the function with the question as an argument
common_functions answer_question "sind bei cpr die kompressionen wichtiger als die luftzufuhr"

